<div class="box-body">
    <p style="text-align:justify;text-indent:40px;">Veristore Tools menyediakan akses ke beberapa fitur salah satunya fitur Verifikasi. Fitur ini dapat diakses oleh Administrator dan Operator, Verifikasi memiliki fungsi  untuk melakukan verifikasi pada terminal X990 dengan memasukan data valid dan memberikan kode aktivasi kepada teknisi. Untuk dapat mengoperasikan fitur ini user diwajibkan untuk mengisi CSI, Tipe EDC, dan Versi App. Setelah semua data diisi user harus menekan tombol cari, maka dengan otomatis data untuk CSI tersebut akan tampil.</p>
    <p style="text-align:justify;text-indent:40px;">Setelah sukses melakukan pencarian CSI maka akan menampilkan data CSI berupa :</p>
    <ol style="text-align:justify;">
        <li>TMS Operator</li>
        <li>CSI</li>
        <li>Serial Number</li>
        <li>Product Number</li>
        <li>Model</li>
        <li>App Name</li>
        <li>App Version</li>
        <li>Host dan merchant address</li>
    </ol>
    <p style="text-align:justify;text-indent:40px;">Pada bagian kanan layar memiliki data yang dimana user diwajibkan mengisi data tersebut yang didapat dari teknisi di lapangan sebelum memberikan kode aktivasi kepada teknisi seperti :</p>
    <ol style="text-align:justify;">
        <li>Teknisi</li>
        <li>Serial Number</li>
        <li>Ticket No</li>
        <li>SPK NO</li>
        <li>Work Order</li>
        <li>Remark</li>
        <li>Status</li>
    </ol>
    <p style="text-align:justify;text-indent:40px;">User dapat merubah Serial Number atau device ID dan dapat tersimpan secara otomatis di Veristore apabila status Done.</p>
    <ol style="text-align:justify;">
        <li>Pada halaman home Veristore silahkan pilih Verifikasi </li>
        <p><img alt="" src="data:image/png;base64,"/></p>
        <li>Maka akan tampil halaman Verifikasi, User diwajibkan mengisi semua field yang ada</li>
        <p><img alt="" src="data:image/png;base64,"/></p>
        <li>Setelah semua data terisi, user dapat menekan tombol Cari</li>
        <p><img alt="" src="data:image/png;base64,"/></p>
        <li>Data CSI akan ditampilkan</li>
        <p><img alt="" src="data:image/png;base64,"/></p>
        <li>Sebelum activation code diberikan kepada teknisi, user diwajibkan mengisi nama Teknisi, Serial Number, SPK NO, Work Orders, Remarks, dan Status Done. lalu dapat menekan tombol Simpan.</li>
        <p><img alt="" src="data:image/png;base64,"/></p>
        <li>Lalu tekan tombol simpan, maka akan muncul notifikasi dan pilih tombol Iya</li>
        <p><img alt="" src="data:image/png;base64,"/></p>
        <li>Data verifikasi berhasil disimpan</li>
        <p><img alt="" src="data:image/png;base64,"/></p>
    </ol>
</div>
